En este caso, aunque reconozco el inicio del poema y parte de su estrofa, no puedo completar con certeza el resto de la composición. Es un soneto de tema mitológico que parece referirse al mito de Leda y el cisne, pero no conozco con seguridad cómo continúa el poema completo.
